For my birthday, I wrote down 5 life lessons / realizations I had over the past year. I decided I wanted to make a little series expanding on each lesson—this is lesson 1: 

If we are all part of the same divine light, every person you encounter is you—from a different timeline, dimension, frequency, and elevation. If all time is happening at the same time, (on a plane rather than linear), each new person you meet is you meeting you in real time. So lead with the same kindness you would want to be shown…because that literally is you. 

Let me know what you think! 🥰⬇️

