MAKEUP I STOLE…kinda 😂 Best way to try new makeup? YOUR FRIENDS’ MAKEUP BAGS 🫡😂🫶🏾 I purchased all my friend’s makeup products that I became obsessed with on my recent trip to see if I actually love it! Enjoy these little mini reviews of each item 🫡🫶🏾💕

@nyxcosmetics plump right back primer: 10/10 amazing primer that creates a sticky base 

@charlottetilbury flawless filter in 5: 5/10 I was obsessed with this when I tried it but now it just feels like overhyped orange goop 

@charlottetilbury airbrush flawless foundation in 8 warm: 10/10 full coverage foundation that does not budge 

@toofaced born this way concealed in golden beige: 9/10 this formula is beautiful and really brightens the under eye 

@morphebrushes setting powder in banana: 9/10 gorgeous setting powder that sculpts my face so well 

@milanicosmetics highlight palette in rose glow: 7/10 it feels a bit chalky on the skin and I think there’s better highlights out there 

@makeupbymario crustal reflector in quartz: 100000/10 this has changed my life I feel like a barbie when I wear it 

@toofaced better than liquid eyeliner: 7/10 it gives you amazing control, especially for the inner wing, but it dried out within a week

@nykaabeauty black magic eyeliner: 10/10 India does NOT PLAY with eyeliners it’s so smooth 

@maccosmetics lipliner in : 7/10 I think this doesn’t work that well for my skin tone but it’s an iconic formula 
.
