How to fake a higher brow—save to try at your own risk 😂🙌🏾 (note: I know this is not for everyone!!) I love my brows: they’re naturally SUPER dense with really long hairs, and they sit low—not a bad thing at all but also not ideal for the 2020 soap brow look that I tried to do but could never really get right 😅🫶🏾 I don’t think the 2020 brow was for me 😂 I feel like this more arched, higher brow fits better with my face shape / brow density and defines my features…but the soap brow could be what suits you best!

My IRL friends asked for this tutorial so here it is but WARNING: it’s definitely not for everyone like pls don’t shave your brows because of me lol. Just sharing my 2023 brow routine in case you’re curious 🫶🏾🫶🏾🫶🏾 Sending love 💜💜💜

